3944=>["Value"=>3944,"TextKey"=>"道具描述12609","TextValue"=>"どこに繋がるのだろう？採集すると<color=#ef933d>魔法の火種</color>と<color=#38c0a5>花精霊の寝床</color>を獲得。"],
