3946=>["Value"=>3946,"TextKey"=>"道具描述12611","TextValue"=>"魔法とトレジャーがどんどん落ちてくる！採集すると<color=#ef933d>魔法の火種</color>と<color=#38c0a5>花精霊の寝床</color>を獲得。"],
