3949=>["Value"=>3949,"TextKey"=>"道具描述12701","TextValue"=>"花精霊たちが七色の羽で作った柔らかい寝床。合成するとより上級な<color=#38c0a5>花精霊の寝床</color>になる。"],
3950=>["Value"=>3950,"TextKey"=>"道具描述12702","TextValue"=>"花精霊たちが七色の羽で作った柔らかい寝床。合成するとより上級な<color=#38c0a5>花精霊の寝床</color>になる。"],
3951=>["Value"=>3951,"TextKey"=>"道具描述12703","TextValue"=>"融合して<color=#ef933d>花精霊のバカンス用寝床</color>を作ってあげよう。"],
