4436=>["Value"=>4436,"TextKey"=>"道具描述1001","TextValue"=>"部族の勇士のトーテム。合成すると<color=#df66a8>部族のやんちゃベイビー</color>を獲得。"],
4437=>["Value"=>4437,"TextKey"=>"道具描述1006","TextValue"=>"部族チャンピオンの上級トーテム。合成すると<color=#df66a8>部族チャンピオン</color>を獲得。"],
4438=>["Value"=>4438,"TextKey"=>"道具描述1101","TextValue"=>"部族の青年のトーテム。合成すると<color=#df66a8>部族のなぜなぜどうしてベイビー</color>を獲得。"],
4439=>["Value"=>4439,"TextKey"=>"道具描述1106","TextValue"=>"部族の青年の上級トーテム。合成すると<color=#df66a8>部族のやり手</color>を獲得。"],
4440=>["Value"=>4440,"TextKey"=>"道具描述1201","TextValue"=>"部族の女性のトーテム。合成すると<color=#df66a8>部族の雛菊</color>を獲得。"],
4441=>["Value"=>4441,"TextKey"=>"道具描述1206","TextValue"=>"部族の女性の上級トーテム。合成すると<color=#df66a8>部族の花</color>を獲得。"],
4442=>["Value"=>4442,"TextKey"=>"道具描述1301","TextValue"=>"部族の司祭のトーテム。合成すると<color=#df66a8>部族のミスティックベイビー</color>を獲得。"],
4443=>["Value"=>4443,"TextKey"=>"道具描述1306","TextValue"=>"部族の司祭の上級トーテム。合成すると<color=#df66a8>部族の祭司学徒</color>を獲得。"],
4444=>["Value"=>4444,"TextKey"=>"道具描述1401","TextValue"=>"部族戦士のトーテムだ。合成すると<color=#df66a8>部族の戦士見習い</color>を獲得。"],
4445=>["Value"=>4445,"TextKey"=>"道具描述1406","TextValue"=>"部族精英戦士のトーテムだ。合成すると<color=#df66a8>部族の戦士精鋭</color>を獲得。"],
4446=>["Value"=>4446,"TextKey"=>"道具描述1501","TextValue"=>"マンモスのトーテム。合成すると<color=#df66a8>ベイビーマンモス</color>を獲得。マンモスの赤ちゃん！"],
4447=>["Value"=>4447,"TextKey"=>"道具描述1506","TextValue"=>"マンモスの上級トーテム。合成すると<color=#df66a8>壮年マンモス</color>を獲得。"],
4448=>["Value"=>4448,"TextKey"=>"道具描述1601","TextValue"=>"魔法キャットのトーテム。なんちゃって～実は<color=#df66a8>ワニ</color>でした。合成すると<color=#df66a8>小型ワニ</color>を獲得。"],
4449=>["Value"=>4449,"TextKey"=>"道具描述1606","TextValue"=>"巨大ワニのトーテム。合成すると<color=#df66a8>ワニ戦士</color>を獲得。"],
4450=>["Value"=>4450,"TextKey"=>"道具描述1701","TextValue"=>"花精霊のトーテム。合成すると<color=#df66a8>ベイビー花精霊</color>を獲得。"],
4451=>["Value"=>4451,"TextKey"=>"道具描述1706","TextValue"=>"花精霊の上級トーテム。合成すると<color=#df66a8>花少女</color>を獲得。"],
4452=>["Value"=>4452,"TextKey"=>"道具描述1801","TextValue"=>"巨人のトーテム。合成すると<color=#df66a8>ベイビーモンスター</color>を獲得。"],
4453=>["Value"=>4453,"TextKey"=>"道具描述1806","TextValue"=>"独眼巨人のトーテム。合成すると<color=#df66a8>強健独眼巨人</color>を獲得。"],
4454=>["Value"=>4454,"TextKey"=>"道具描述1901","TextValue"=>"チョコボのトーテムだ。合成すると<color=#df66a8>チョコボの赤ちゃん</color>を獲得。"],
4455=>["Value"=>4455,"TextKey"=>"道具描述1906","TextValue"=>"大チョコボのトーテムだ。合成すると<color=#df66a8>見習うチョコボ</color>を獲得。"],
4456=>["Value"=>4456,"TextKey"=>"道具描述2001","TextValue"=>"石精霊のトーテム。合成すると<color=#df66a8>ベイビー石精霊</color>を獲得。"],
4457=>["Value"=>4457,"TextKey"=>"道具描述2006","TextValue"=>"石精霊の上級トーテム。合成すると<color=#df66a8>森の巨石</color>を獲得。"],
4458=>["Value"=>4458,"TextKey"=>"道具描述2101","TextValue"=>"カタツムリのトーテムだ。合成すると<color=#df66a8>西瓜カタツムリ</color>を獲得。"],
4459=>["Value"=>4459,"TextKey"=>"道具描述2106","TextValue"=>"自然カタツムリのトーテムだ。合成すると<color=#df66a8>葡萄カタツムリ</color>を獲得。"],
4460=>["Value"=>4460,"TextKey"=>"道具描述2201","TextValue"=>"部族は強い竜を崇拝している！合成すると<color=#df66a8>ビッグヘッドリザード</color>を獲得。"],
4461=>["Value"=>4461,"TextKey"=>"道具描述2206","TextValue"=>"はるか昔からやってきた。合成すると<color=#df66a8>火炎竜</color>を獲得。"],
4462=>["Value"=>4462,"TextKey"=>"道具描述2301","TextValue"=>"サーベルタイガーを飼いならそうとする者が後をたたない。合成すると<color=#df66a8>ベイビー食肉獣</color>を獲得。"],
4463=>["Value"=>4463,"TextKey"=>"道具描述2306","TextValue"=>"鋭い牙を見せつけて。合成すると<color=#df66a8>素早いサーベルタイガー</color>を獲得。"],
4464=>["Value"=>4464,"TextKey"=>"道具描述18601","TextValue"=>"創世神のご指示。"],
4465=>["Value"=>4465,"TextKey"=>"道具描述18701","TextValue"=>"土を突き破る新たな命。融合するとより上級の<color=#38c0a5>竹</color>になる。"],
4466=>["Value"=>4466,"TextKey"=>"道具描述18702","TextValue"=>"少しずつ大きくなっていく。融合するとより上級の<color=#38c0a5>竹</color>になる。"],
4467=>["Value"=>4467,"TextKey"=>"道具描述18703","TextValue"=>"他の丈とはちょっと違うけど、可愛いことに変わりはない。融合するとより上級の<color=#38c0a5>竹</color>になる。"],
4468=>["Value"=>4468,"TextKey"=>"道具描述18704","TextValue"=>"大きくなってきた！融合するとより上級の<color=#38c0a5>竹</color>になる。"],
