11384=>["Value"=>11384,"TextKey"=>"图鉴描述10502","TextValue"=>"私たちの時代の最も偉大なウィザードとして認識されている彼は、ユニークな才能があり、親切で、優しく、洞察力に富んだ人物だ。彼はしばしばウサギのように見える。彼の本当の顔を見た人はほとんどいない。"],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10503","TextValue"=>"英雄的な物語を作成し、唱えるのが得意な部族の詩人と歌手。彼の並外れた知恵で、多くの斬新な物語が世界に歌われてきた。"],
