11388=>["Value"=>11388,"TextKey"=>"图鉴描述10506","TextValue"=>"彼女は、人を泣かせた悲しい過去を持っているが、苦しみは彼女を強くしただけではない。彼女は火の光の幻影を実現させる不思議な魔法も学んだ。"],
