12672=>["Value"=>12672,"TextKey"=>"新手引导题头文本2531","TextValue"=>"ビーチバケーション"],
12673=>["Value"=>12673,"TextKey"=>"新手引导题头文本2532","TextValue"=>"ビーチバケーション"],
12674=>["Value"=>12674,"TextKey"=>"新手引导题头文本2534","TextValue"=>"スピードワーカー"],
12675=>["Value"=>12675,"TextKey"=>"新手引导题头文本2540","TextValue"=>"英雄の家"],
12676=>["Value"=>12676,"TextKey"=>"新手引导题头文本2541","TextValue"=>"英雄の家"],
12677=>["Value"=>12677,"TextKey"=>"新手引导题头文本2542","TextValue"=>"部族プリンセス"],
12678=>["Value"=>12678,"TextKey"=>"新手引导题头文本2543","TextValue"=>"作物を集める"],
12679=>["Value"=>12679,"TextKey"=>"新手引导题头文本2544","TextValue"=>"魔法の本"],
12680=>["Value"=>12680,"TextKey"=>"新手引导说明1012","TextValue"=>"<color=#38aec0><color=#f58c26>マイハウス</color></color>が開放されました。見に行きましょう！"],
12681=>["Value"=>12681,"TextKey"=>"新手引导说明2000","TextValue"=>"通りかかった人よ、助けてください！"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2001","TextValue"=>"<color=#38c0a5>トーテム</color>に封印されてしまった！"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2002","TextValue"=>"任意の<color=#38c0a5>トーテム</color>をドラックして、3個の<color=#38c0a5>トーテム</color>が隣り合うようにして融合させば、封印を解くことができます！"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2010","TextValue"=>"あっ！ここには<color=#38c0a5>トーテム</color>がない。"],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2011","TextValue"=>"見て！<color=#f58c26>創世神の法典</color>だ。これは各ステージにも存在し、その中の記録はきっと役に立つでしょ。"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2012","TextValue"=>"タップしてゲームに関する説明を確認できます。試してみてください！"],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2020","TextValue"=>"ステージをクリアするには、指定されたアイテムを入手する必要があります。"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2022","TextValue"=>"ステージ目標には必要なアイテムが表示されます。融合してクリアしよう！"],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2030","TextValue"=>"わお！<color=#ef933d>創世少女の像</color>だ！彼女達の力は消えている！融合で彼女を呼び覚ましましょう！"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2031","TextValue"=>"<color=#ef933d>創世少女の像</color>のあるステージでは、彼女達を合成して勝利するのが一般的です。"],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2032","TextValue"=>"この地は<color=#f58c26>創世少女の像</color>との繋がりが切れたため、眠りに落ちています。"],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2033","TextValue"=>"<color=#38aec0>眠りの地</color>の物を移動することはできません！"],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2034","TextValue"=>"任意の<color=#38c0a5>ブルーム</color>を合成することで土地を呼び覚まします。"],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2035","TextValue"=>"ステージクリア後、<color=#f58c26>創世少女</color>が魔術師に呪われた土地を呼び覚ましてくれます！"],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2040","TextValue"=>"見て！<color=#38c0a5>トーテム</color>だ！"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2041","TextValue"=>"3個の<color=#38c0a5>トーテム</color>を融合して仲間を救いましょう！"],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2050","TextValue"=>"さっき言ったように、大地<color=#38c0a5>ルーンオーブ</color>をタップすると土地を呼び覚ますことができます。"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2051","TextValue"=>"もちろん上級の大地<color=#38c0a5>ルーンオーブ</color>を合成することもできます。"],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2060","TextValue"=>"普通と<color=#38aec0>眠りの地</color>のと同じアイテムを合成することで、<color=#38aec0>眠りの地</color>は呼び覚まされます。"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2070","TextValue"=>"<color=#38c0a5>トーテム</color>群をタップすると「<color=#38c0a5>トーテム</color>」を入手します。"],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2080","TextValue"=>"一部の<color=#38aec0>超級眠りの地<color=#38aec0>は<color=#38aec0>治癒値</color>によって呼び覚ますことはできません。普通の土地のアイテムと合成することしか呼び覚ますことができません。"],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2090","TextValue"=>"ここからはステージに任務が追加されます。"],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2091","TextValue"=>"任務太陽をタップして詳細と報酬を確認できます。"],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2093","TextValue"=>"このボタンは画面のドラックをロックまたはアンロックできます。"],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2100","TextValue"=>"一部のアイテムは直接融合できません。<color=#ef933d>楔形の石積み</color>をタップして<color=#ef933d>楔形の石</color>に変換させてから融合できます。"],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2110","TextValue"=>"ステージのクリア条件を確認してください。"],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2130","TextValue"=>"様々な<color=#38c0a5>竜骨</color>から<color=#ef933d>灌木の芽</color>を入手できる。"],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2140","TextValue"=>"超大型の<color=#ef933d>目覚め爆弾</color>。隣接する土地を呼び覚ますと、自動的に覚醒します。覚醒すると同時に周辺1コマの土地を呼び覚まします。"],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2150","TextValue"=>"部族の仲間は上級の<color=#38c0a5>蔦</color>から<color=#38c0a5>原石鉱</color>を採取できます。タップして採取しましょう。"],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2160","TextValue"=>"<color=#ef933d>砕けた墓碑</color>。放置または合成すると怖いゾンビに変わります。ゾンビを倒すと、アイテム<color=#38c0a5>蛍</color>を獲得します。ステージをクリアするのに必要なアイテムです。"],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2170","TextValue"=>"覚醒状態に関係なく、<color=#ef933d>荒廃した壁巣</color>からゾンビは次々と発生すします。タップするとゾンビが1匹現れます。<color=#ef933d>荒廃した壁巣</color>を破壊すると大量の原石鉱を獲得できます。"],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2180","TextValue"=>"これは<color=#ef933d>ドルイドのルーンポータル</color>、ラッキー！合成することで拠点からランダムの<color=#38c0a5>部族の仲間<color=#38c0a5>を1人召喚できます。"],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2190","TextValue"=>"創世神木から残された聖物です。<color=#38c0a5>大地ルーンオーブ</color>を自動的に生成し、土地を呼び覚まします。創世神木の聖遺物のレベルが高いほど、治癒能力が強くなります。"],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2200","TextValue"=>"<color=#ef933d>荒野の雲</color>が次々と発生します。タップすると雨が降ります。雨が降った空白土地には、<color=#38c0a5>水溜り</color>と<color=#38c0a5>ブルーム</color>が生成されます。"],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2210","TextValue"=>"あれ、<color=#ef933d>創世少女の像</color>はどこに？"],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2211","TextValue"=>"そうですね。任務を達成すれば、彼女は現れるようです！"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2220","TextValue"=>"これは<color=#ef933d>魔神像</color>です。厭らしい！部族の仲間に処分させれば、<color=#ef933d>創世少女の像</color>を獲得できます。"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2230","TextValue"=>"新たな拠点が開放されました。<color=#f58c26>世界マップ</color>で確認しましょう。"],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2240","TextValue"=>"やっと解放された。ありがとうございます。"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2241","TextValue"=>"部族の仲間達が<color=#38c0a5>トーテム</color>に閉じ込められました。"],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2242","TextValue"=>"我々の部族にはあなたが必要です。閉じ込められた仲間を探してください。"],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2243","TextValue"=>"次のステージに行ってみよう！"],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2250","TextValue"=>"一部のアイテムをダブルタップ、または部族員をアイテムにドラックすることで採取させられます。"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2251","TextValue"=>"採取されたアイテムを使用や合成することができます。"],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2252","TextValue"=>"<color=#38c0a5>ブルーム</color>を採取すると<color=#38c0a5>ルーンオーブ</color>がもらえます。"],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#38c0a5>ルーンオーブ</color>をタップすると眠りの土地を呼び覚ますことができます。"],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2261","TextValue"=>"ここからはステージ終了時に報酬を選べます。"],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2262","TextValue"=>"報酬は主に金貨と有用なアイテムです。たまに<color=#38c0a5>トーテム</color>が出るかも。"],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2263","TextValue"=>"報酬は<color=#38aec0>大地のバブル</color>に詰め込まれて、<color=#f58c26>家</color>に送られます。"],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明3000","TextValue"=>"ここが私達の<color=#f58c26>家</color>です。"],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3001","TextValue"=>"私達の部族はここで暮らしていました。しかしあの大洪水によって<color=#f58c26>家</color>は潰され、土地は霧に覆われてしまいました。家を出ることしか選択肢はありませんでした。"],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3002","TextValue"=>"アイテムを<color=#38aec0>眠りの地</color>のアイテムと融合させればこの地を呼び覚ますことができます。融合して部族員を解放してみましょう。霧を払うことができるはずです。"],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3005","TextValue"=>"<color=#38c0a5>時間の宝箱</color>は最大1個開けられます。カウントダウンが終わると報酬を獲得できます。<color=#38c0a5>宝石</color>を消費して任意の<color=#38c0a5>時間の宝箱</color>を直接開けることもできます。"],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3006","TextValue"=>"ステージの報酬は届きました。バブルを開けて確認しましょう。"],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3010","TextValue"=>"<color=#38c0a5>長屋</color>は部族の仲間の休憩場です。時間が経つと部族の仲間が再活動できます。"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3011","TextValue"=>"<color=#38c0a5>長屋</color>は上級の長屋に合成することができます。長屋のレベルが高いほど、必要な休憩時間が短くなります。"],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3016","TextValue"=>"<color=#38c0a5>宝石</color>を消費してすぐ呼び覚ますことができます。"],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3030","TextValue"=>"<color=#f58c26>家</color>の任務を達成するとさらなる<color=#38c0a5>大地の遺産</color>を入手できます。<color=#38c0a5>大地の遺産</color>をタップすると特殊な戦利品を入手できます。"],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3040","TextValue"=>"これは小さな<color=#38c0a5>金鉱</color>です。"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3041","TextValue"=>"タップすると金貨資源を手に入れられます。上級の<color=#38c0a5>金鉱</color>に合成することもできます。"],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3042","TextValue"=>"<color=#38c0a5>金鉱</color>資源は<color=#f58c26>ショップ</color>で使うことができます。"],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3050","TextValue"=>"<color=#38c0a5>金鉱</color>がいっぱいになった？<color=#f58c26>ショップ</color>で何か買ってみませんか？"],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3060","TextValue"=>"<color=#df66a8>部族の仲間</color>は皆疲れたようです。暫く休憩が必要です。"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3061","TextValue"=>"ステージに挑戦し、さらに多くの部族員を助けましょう！"],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3062","TextValue"=>"部族員が多いほど、休憩するまでに採取できる物が多くなります！"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3063","TextValue"=>"ステージをクリアしてより多くの部族員を救い、"],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3064","TextValue"=>"家に送ってあげましょう！"],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3065","TextValue"=>"ほら！ここから<color=#f58c26>世界マップ</color>でステージに向かうことができますよ！"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3070","TextValue"=>"もう置く場所がありません！地面に置きっぱなしにされています！"],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3071","TextValue"=>"アイテムを1つ選択し、情報区域で売却または廃棄しましょう。"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3080","TextValue"=>"これは非常に珍しい<color=#38c0a5>異星の大地の遺産</color>！タップして<color=#38c0a5>宝石</color>を獲得できます。上級の「異星の遺産」に合成することもできます。"],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3090","TextValue"=>"これは<color=#38c0a5>原石</color>のくずです。"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3091","TextValue"=>"タップすると<color=#38c0a5>原石</color>資源が手に入ります。上級の原石鉱に合成することもできます。"],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3092","TextValue"=>"<color=#38c0a5>原石</color>資源は<color=#f58c26>ショップ</color>で使うことができます。"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3100","TextValue"=>"<color=#38c0a5>原石</color>がいっぱいになったら、<color=#f58c26>ショップ</color>で消費しましょう。"],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3110","TextValue"=>"これは憎らしい<color=#38c0a5>障害物</color>です。普段は動かすことはできません。<color=#df66a8>部族の仲間</color>に攻撃指示をする、または<color=#38c0a5>障害物</color>をダブルタップしましょう。<color=#38c0a5>路障</color>を破壊すると小さな<color=#38c0a5>障害物</color>が残る時もあります。"],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3120","TextValue"=>"呼び覚まされていない<color=#38c0a5>砲台</color>でも周辺の汚染された土地を攻撃できます。砲撃の間隔はゲージで表示されます。砲台を攻撃するには呼び覚ます事が必要です！"],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3130","TextValue"=>"これは<color=#f58c26>英雄の祭壇</color>です。英雄を休憩またはパトロール状態に切り替えられます。"],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3131","TextValue"=>"英雄が居る時、任意の4融合におまけがつきます！"],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3132","TextValue"=>"休憩状態の時、<color=#38c0a5>宝石</color>を消費して起すことができます。"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3133","TextValue"=>"ここをタップして英雄の詳細情報を確認できます。"],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3142","TextValue"=>"英雄は部族の強力なユニットで、独特なスキルを持ちます。"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3144","TextValue"=>"英雄スキル。ここで英雄スキルの説明を確認できます。"],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3145","TextValue"=>"使命を提出して英雄のレベルを上げることができます。"],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3147","TextValue"=>"すべての依頼を達成すると英雄のレベルが上がります。"],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3150","TextValue"=>"すごいです、より多くの部族員の封印が解かされました！"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3151","TextValue"=>"部族の人口が増えましたし、霧払いも捗ります！"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3152","TextValue"=>"各区域の霧はある程度の<color=#f58c26>部族の力</color>がないと払えません。"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3153","TextValue"=>"タップして一部の霧が払うことができます。"],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3161","TextValue"=>"この霧は払えません"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3162","TextValue"=>"<color=#f58c26>部族の力</color>が不足います。<color=#f58c26>ショップ</color>で<color=#38c0a5>トーテム</color>を購入できます。"],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3165","TextValue"=>"金貨を使って<color=#38c0a5>トーテム</color>を購入できます。"],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3166","TextValue"=>"<color=#38c0a5>トーテム</color>を購入する度、価格は高くなります。金貨を集めましょう。"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明2270","TextValue"=>"<color=#f58c26>時間制限ステージ</color>、時間内にクリアする必要があります。"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2271","TextValue"=>"以下の区域でステージの残り時間が表示されます。"],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2273","TextValue"=>"時間が経つにつれて、数字の色は<color=#46bb83>緑色</color>から<color=#eca852>黄色</color>、 <color=#e04030>赤色</color>に変わります"],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2274","TextValue"=>"効率を上げるため、<color=#f58c26>ショップ</color>を覗いてみましょう。"],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2277","TextValue"=>"<color=#38c0a5>宝石</color>を消費し、<color=#f58c26>ショップ</color>で重要アイテムを直接購入できます"],
