13549=>["Value"=>13549,"TextKey"=>"向攻击移动文字1041","TextValue"=>"パーティーの邪魔をするな！"],
13550=>["Value"=>13550,"TextKey"=>"向攻击移动文字1042","TextValue"=>"離れろ！"],
13551=>["Value"=>13551,"TextKey"=>"向攻击移动文字1043","TextValue"=>"やりの準備はできている！"],
13552=>["Value"=>13552,"TextKey"=>"向攻击移动文字1044","TextValue"=>"いいよ。"],
13553=>["Value"=>13553,"TextKey"=>"向攻击移动文字1045","TextValue"=>"いいよ、君のためなら。"],
13554=>["Value"=>13554,"TextKey"=>"向攻击移动文字1046","TextValue"=>"はいはい、来たよ。"],
13555=>["Value"=>13555,"TextKey"=>"向攻击移动文字1047","TextValue"=>"行こう。"],
13556=>["Value"=>13556,"TextKey"=>"向攻击移动文字1048","TextValue"=>"鼻を叩かないで！！"],
13557=>["Value"=>13557,"TextKey"=>"攻击过程文字1001","TextValue"=>"部族のために！"],
13558=>["Value"=>13558,"TextKey"=>"攻击过程文字1002","TextValue"=>"神の懲罰"],
13559=>["Value"=>13559,"TextKey"=>"攻击过程文字1003","TextValue"=>"この衝撃に耐えられるか？"],
13560=>["Value"=>13560,"TextKey"=>"攻击过程文字1004","TextValue"=>"これでも喰らえ！"],
13561=>["Value"=>13561,"TextKey"=>"攻击过程文字1005","TextValue"=>"罰を受けよ！"],
13562=>["Value"=>13562,"TextKey"=>"攻击过程文字1006","TextValue"=>"圧倒的"],
13563=>["Value"=>13563,"TextKey"=>"攻击过程文字1007","TextValue"=>"死を受け入れよ"],
13564=>["Value"=>13564,"TextKey"=>"攻击过程文字1008","TextValue"=>"ピンポイントスナイピング。"],
13565=>["Value"=>13565,"TextKey"=>"攻击过程文字1009","TextValue"=>"砕いてやる"],
13566=>["Value"=>13566,"TextKey"=>"攻击过程文字1010","TextValue"=>"我が怒りの中に消えよ"],
13567=>["Value"=>13567,"TextKey"=>"攻击过程文字1011","TextValue"=>"投降しろ！"],
13568=>["Value"=>13568,"TextKey"=>"攻击过程文字1012","TextValue"=>"死ね！"],
13569=>["Value"=>13569,"TextKey"=>"攻击过程文字1013","TextValue"=>"これでも喰らえ！"],
13570=>["Value"=>13570,"TextKey"=>"攻击过程文字1014","TextValue"=>"傷付けたくない。"],
13571=>["Value"=>13571,"TextKey"=>"攻击过程文字1015","TextValue"=>"鼻を叩かないで！！"],
13572=>["Value"=>13572,"TextKey"=>"攻击过程文字1016","TextValue"=>"死ね！"],
13573=>["Value"=>13573,"TextKey"=>"攻击过程文字1017","TextValue"=>"制裁を受ける"],
13574=>["Value"=>13574,"TextKey"=>"攻击过程文字1018","TextValue"=>"無敵だぜ！"],
13575=>["Value"=>13575,"TextKey"=>"攻击过程文字1019","TextValue"=>"仙女には勝てないよ！"],
13576=>["Value"=>13576,"TextKey"=>"攻击过程文字1020","TextValue"=>"生きて帰れると思うな"],
13577=>["Value"=>13577,"TextKey"=>"攻击过程文字1021","TextValue"=>"喰らえ"],
13578=>["Value"=>13578,"TextKey"=>"攻击过程文字1022","TextValue"=>"失せろ"],
13579=>["Value"=>13579,"TextKey"=>"攻击过程文字1023","TextValue"=>"嵐の中へ消えろ。"],
13580=>["Value"=>13580,"TextKey"=>"攻击过程文字1024","TextValue"=>"塵は塵へ、土は土へ。"],
13581=>["Value"=>13581,"TextKey"=>"攻击过程文字1025","TextValue"=>"パーティーの邪魔をするな！"],
13582=>["Value"=>13582,"TextKey"=>"攻击过程文字1026","TextValue"=>"離れろ！"],
13583=>["Value"=>13583,"TextKey"=>"攻击过程文字1027","TextValue"=>"行け！"],
13584=>["Value"=>13584,"TextKey"=>"攻击过程文字1028","TextValue"=>"行こう。"],
13585=>["Value"=>13585,"TextKey"=>"攻击过程文字1029","TextValue"=>"部族には勝てないよ"],
13586=>["Value"=>13586,"TextKey"=>"攻击过程文字1030","TextValue"=>"制裁を受ける"],
13587=>["Value"=>13587,"TextKey"=>"攻击过程文字1031","TextValue"=>"へいや～"],
13588=>["Value"=>13588,"TextKey"=>"攻击过程文字1032","TextValue"=>"我を恐れよ！"],
13589=>["Value"=>13589,"TextKey"=>"攻击过程文字1033","TextValue"=>"負けを認めろ！"],
13590=>["Value"=>13590,"TextKey"=>"攻击过程文字1034","TextValue"=>"死ね"],
13591=>["Value"=>13591,"TextKey"=>"攻击过程文字1035","TextValue"=>"嵐の中へ消えろ。"],
13592=>["Value"=>13592,"TextKey"=>"攻击过程文字1036","TextValue"=>"稲妻の中で消えろ。"],
13593=>["Value"=>13593,"TextKey"=>"攻击过程文字1037","TextValue"=>"このパーティーコンビパンチでも喰らえ！"],
13594=>["Value"=>13594,"TextKey"=>"攻击过程文字1038","TextValue"=>"離れろ！"],
13595=>["Value"=>13595,"TextKey"=>"攻击过程文字1039","TextValue"=>"家を守るんだ！"],
13596=>["Value"=>13596,"TextKey"=>"天气雷名称100001","TextValue"=>"雷"],
13597=>["Value"=>13597,"TextKey"=>"天气雷描述100001","TextValue"=>"雷をアイテムに置くと同じアイテムを吸着できる。"],
13598=>["Value"=>13598,"TextKey"=>"剧情ID1010101","TextValue"=>"おはようございます、族長！私はトリスタン、あなたの忠実な偵察兵です！困難な道のりでしたが、お互い生き延びられてよかったです！陸地が発見されましたので、<color=#f58c26>拠点</color>を作りましょう。"],
13599=>["Value"=>13599,"TextKey"=>"剧情ID1010102","TextValue"=>"緑豊かな場所ですね！この先に何が待ってるでしょう？とりあえずテントを張っておきましょう！"],
13600=>["Value"=>13600,"TextKey"=>"剧情ID1010201","TextValue"=>"神よ、なんてとこなの……貧しい土地に、ボロボロなテント！家に帰りたい..."],
13601=>["Value"=>13601,"TextKey"=>"剧情ID1010202","TextValue"=>"エンダー、あなたにとって家を出るのは大変なのはわかります、しかしそれ以外選択肢はないんです。あの自然災害は尋常ではありません……原因を調べなければ！そのために助けを求めに家を離れたんですから。"],
13602=>["Value"=>13602,"TextKey"=>"剧情ID1010203","TextValue"=>"家に帰る方法もきっとあります。まずは<color=#f58c26>祭壇</color>を造って、神と対話する場を設けましょうか、祭司エンダー？族長が手伝ってくれます！"],
13603=>["Value"=>13603,"TextKey"=>"剧情ID1020101","TextValue"=>"見てください！<color=#ef933d>大地の遺産</color>を見つけました！これで<color=#f58c26>祭壇</color>を造るのに必要な素材が揃いました。さらにトーテム封印の解除方法もわかりました！この地は素晴らしい！"],
13604=>["Value"=>13604,"TextKey"=>"剧情ID1020201","TextValue"=>"少しは役に立ったようね……あのスタンってやつ。うちにある祭壇と比べてだいぶ小さいし、迫力もないけど、今はこれで妥協するわ。ほら、あっち行きなさい！"],
13605=>["Value"=>13605,"TextKey"=>"剧情ID1020202","TextValue"=>"おやおや～かわいい！素直じゃない喜び方も！"],
13606=>["Value"=>13606,"TextKey"=>"剧情ID1020203","TextValue"=>"（奇妙な踊りを踊った）ここが正しい場所、これからは大事な人に出会うと、我々の神が言っていたわ……"],
13607=>["Value"=>13607,"TextKey"=>"剧情ID1020204","TextValue"=>"本当ですか？とっておきのビッグニュースですね！いつその人に会えますか？"],
13608=>["Value"=>13608,"TextKey"=>"剧情ID1020301","TextValue"=>"貴様らが俺を眠りから目覚めさせたのか？！"],
13609=>["Value"=>13609,"TextKey"=>"剧情ID1020302","TextValue"=>"……どちら様でしょうか？"],
13610=>["Value"=>13610,"TextKey"=>"剧情ID1020303","TextValue"=>"我はドルイド・吟遊詩人の祖・嵐の征服者・冒険者の守護神・神の代行者にして使者・公正なる大法官・歌のアメイジンなり！"],
13611=>["Value"=>13611,"TextKey"=>"剧情ID1020304","TextValue"=>"えっと……お会いできて光栄です、かな？私達はよそから来た者です。今さっき……"],
13612=>["Value"=>13612,"TextKey"=>"剧情ID1020305","TextValue"=>"なに？！よそから侵略者だと？！家を壊し、家庭を潰すような機会は与えん！"],
13613=>["Value"=>13613,"TextKey"=>"剧情ID1020401","TextValue"=>"ええ？ち、違います！侵略者じゃありません！暫く滞在するだけです。ついでに私達の家の謎を解明できたら……"],
13614=>["Value"=>13614,"TextKey"=>"剧情ID1020402","TextValue"=>"へえ、橋！やってくれたわね！神が怒るわ！ちょっと待って……あなたがアメイジン？ドルイドのアメイジン？伝説のあの人？"],
13615=>["Value"=>13615,"TextKey"=>"剧情ID1020403","TextValue"=>"お前達は……侵略者じゃないのか？ならば何者だ？ここで何をしてる？ううん……俺は何をしている？ここはどこだ？我が民はどうした？この場所、俺の記憶にない……"],
13616=>["Value"=>13616,"TextKey"=>"剧情ID1020404","TextValue"=>"すみません、私達もわかりません。命の危険を冒してはるばるやってきたのは、家の謎を解く者を探すためです。私達の家は謎の濃い霧に覆われ、そして……"],
13617=>["Value"=>13617,"TextKey"=>"剧情ID1020405","TextValue"=>"去年一年で起こった洪水の量は過去十年よりも多かったんです。もっとおかしいのは、族人が次々と無機質なトーテムに変わっていったんです！信じられませんよね？！"],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1020406","TextValue"=>"ほう……とんでもない事情があるんだな。さっきはお前達の橋を壊しちまって、すまなかった。建て直すのを手伝ってあげようか？"],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1020407","TextValue"=>"アメイジン？！偉大なアメイジン？！そのローブ、自然を操る力……あなたは本物よ！我が部族の蔵書に書かれていた伝説はすべて本当だったわ！"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1020408","TextValue"=>"みんな、頑張ってあの橋を建て直すのだ！"],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1020409","TextValue"=>"私達は怪我をしてます！このままじゃ働けません！"],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1020410","TextValue"=>"お前達に必要なモノはわかった。長い旅で薬草の知識をたくさん学んできたもんでな。薬草を集め、<color=#f58c26>薬草園</color>を作ってあげよう。俺からのお詫びということでな。"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020411","TextValue"=>"それはありがたい！あなたは良い人ですね。新しく学んだ知識でトーテムに閉じ込められた人達を救ってみせます！よし、出発です！"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1030101","TextValue"=>"ただいま、助っ人を連れてきました！さっそく<color=#f58c26>薬草園</color>を建てましょう！"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1030201","TextValue"=>"ほう、中々いい腕前だな！素敵な薬草園だ。"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1030202","TextValue"=>"実用性もバッチリです！みんなの怪我も治りましたし、橋を再建できます！"],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1030203","TextValue"=>"それならよかった。"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1030204","TextValue"=>"ところで、さっきまで祭司があなたの美徳と博識に感服していましたよ。私は……"],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1030205","TextValue"=>"あなたのような経験豊富な冒険者が、もし私達の仲間になることができれば、この上ない幸せです。しかしあなたはレジェンド！簡単に見ず知らずの人達についていくはずもない！それともありなの？お願いです、仲間になってください！"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1030206","TextValue"=>"いいぜ。それが俺がここに居る理由かもしれんな。"],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1030207","TextValue"=>"やはり、だめか……ええ！一緒に来てくれるの？！ああ、私は夢を見ているかしら……今日は人生最高の日だわ！"],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1030208","TextValue"=>"すみません、彼女はたまにあんな感じなので。晴れて仲間になれたことですし、歓迎パーティーを開きましょうか？"],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1030209","TextValue"=>"結構だ、パーティーがなくても気にしないさ。それより今はもっと大事なことがある。木を集め、俺が壊した橋を直さなければ。"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1030210","TextValue"=>"なんて素敵な人！ああ！彼に会えることだけで……人生最高の日だわ！"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1040101","TextValue"=>"お前が……族長、だよな？さっきは助かった、礼を言う。橋を作る用意は出来ている。"],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1040201","TextValue"=>"まるで新しい橋みたいです！祭司エンダー、神と対話する準備は出来てますか？"],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1040202","TextValue"=>"今まで以上にバッチリよ！"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1040301","TextValue"=>"よし、族長、祭司は最愛の祭壇と再会できましたし、私達は他の仕事を……"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1040401","TextValue"=>"おっと！何かに足を引っ掛けられました？はあ、<color=#f58c26>祭壇</color>から落ちた<color=#38c0a5>原石</color>ですね。気をつけて仕事しませんと。"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1040402","TextValue"=>"あ！思いつきました！私達にはいろんな資材を保管する<color=#f58c26>倉庫</color>が必要です。そしたら、地面に散らばったものに足を引っ掛けることはないでしょう。"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1050101","TextValue"=>"ものは用意できました？ではカーニバルだ！失礼、<color=#f58c26>倉庫</color>を作りましょう。"],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1050201","TextValue"=>"たくましい壁、広くて明るい室内……族長の建造の腕前は日々上達してますね！"],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1050202","TextValue"=>"あれ、上官？後ろに八本足のものがついてますよ。"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1050301","TextValue"=>"なに？！なんだ？！こいつは何なのだ？！水生動物の死体に見えますね……ふむ、つるつるでぽよんぽよん。"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1050302","TextValue"=>"<color=#f58c26>北海巨妖</color>だ！これは<color=#f58c26>北海巨妖</color>だ！！本で読んだことある、きっとあの化け物の子に違いない！なんでこんな所に<color=#f58c26>北海巨妖</color>がいるんだ？！"],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1050303","TextValue"=>"大丈夫だ、すでに死んでる。それにこいつはただの<color=#f58c26>タコ</color>だ。"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1050304","TextValue"=>"タコ？初耳ですね……"],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1050305","TextValue"=>"お前達は内陸から来たんだな。我が部族は航海の部族、海と生きてきた。俺達にとってタコなんて夜空の星のように普通さ。"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1050306","TextValue"=>"よし、ついて来い、縄と枝を集めろ。タコの皮でテントを張ってみせるぜ。"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1060101","TextValue"=>"……こうして……こう、できた。思ってたよりブサイクだな。"],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1060102","TextValue"=>"こ……これは……かわいい！"],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1060103","TextValue"=>"すまない、手を動かすより、俺は理論派でね。物作りは……あまり得意じゃない。すこし……休ませてくれ……"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1060104","TextValue"=>"ああ偉大なアメイジンよ！一緒に大テントのほうで休みませんか？知恵を授けてくれた代わりに、私は一生あなたの忠実な侍者になりますわ……"],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1060201","TextValue"=>"祭司は夢が叶ったみたいですね。二人が仲良しでなによりです。しかし、気になる点がありますね、族長？"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1060202","TextValue"=>"部落の老人達の話によると、海という場所に行って帰ってくる者はいません。「あの世界の果てには水の壁がある」ってつぶやくイカれた野郎を除いて。"],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1060203","TextValue"=>"しかしアメイジンは海の部族だと言いました！誰も海上に住んでませんよ！"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1060204","TextValue"=>"そこが噛み合わないですね。彼は悪いことをしてませんし、とりあえずほっときますか。仕事に戻りましょ。"],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1060205","TextValue"=>"大きい区域の探索を終えましたので、拠点が大量の戦利品でいっぱいです。家畜がそれを家まで運んでくれます。家畜達が暮らす<color=#f58c26>畜舎</color>を造ってあげましょう。"],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1070101","TextValue"=>"良い感じですね、族長！もうすぐあの子達の働きぶりがお披露目されるでしょう。最高です！"],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1070102","TextValue"=>"建造の仕事はもうすぐ終わりそうです。あと一つお願いがあります。"],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1070103","TextValue"=>"私達が拠点を留守にしてる間に悪事を働く輩がいるかもしれません。それを備えるためにも斥候小隊を編成し周辺をパトロールする必要があります。"],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1070104","TextValue"=>"そのために<color=#f58c26>訓練場</color>を作るんですね！"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1070105","TextValue"=>"<color=#f58c26>訓練場</color>、その通りですケビン！素材を探しましょう！"],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1080101","TextValue"=>"準備はできましたかね？"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1080102","TextValue"=>"できました、長官！"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1080103","TextValue"=>"族長が素材を用意してくれました。あとは私達の出番です！"],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1080104","TextValue"=>"はい長官、イエス長官！"],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1080201","TextValue"=>"お見事です！さてと……祭司？どうしましたか？"],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1080301","TextValue"=>"さっきドルイドアメイジンさんとお話してたら、疲れて眠ってしまい、そして同じ夢を見たわ。夢で一人の女神が「<color=#f58c26>オーシャンハート</color>を助けてください」って……"],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1080302","TextValue"=>"<color=#f58c26>オーシャンハート</color>？それは一体？"],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1080303","TextValue"=>"俺の部族に伝わる伝説だ。深海には大きな泡があって、あの一番幼い女神がそれを守っていた。古き動物は泡の中で生き残り、しかも、中には巨人や精霊もいると言われてる。所詮は子供騙しの物語だけどな。"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1080304","TextValue"=>"私はこの件を解明する。女神の声をよく聞こえるよう、<color=#f58c26>強いルーンの台座</color>が必要だわ。"],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1080305","TextValue"=>"かしこまりました！では、族長、原石を集め、エンダーに台座を作ってあげましょう！"],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1090101","TextValue"=>"そろそろ仕事は終わります、お祝いの時間です！"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1090102","TextValue"=>"やったぜ！"],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1090201","TextValue"=>"静かに！これじゃ集中できないわ！"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1090202","TextValue"=>"神と対話しようとしてるのに、あなた達のせいでくちゃくちゃだわ！"],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1090203","TextValue"=>"黙って！私の仕事の邪魔をしないで！"],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1090204","TextValue"=>"おや、ご機嫌斜めみたいですね。"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1090205","TextValue"=>"ちょっと！静かに！彼女の声が聞こえてきた気がする。今大事なところよ。"],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1090206","TextValue"=>"んん……はっきり聞こえない……たぶん、北へ進めと言われてる。動物の姿はおろか、草すら生えてない場所まで。そこで一人の友と出会えるって。"],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1090207","TextValue"=>"まあ、行けなくは……ないですが？ううん、大丈夫でしょう？北へ進むとしましょ！"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1090208","TextValue"=>"その前に、新しい拠点の設立を祝わせてください！みんな集まって、盛大なパーティーを開きますよ！"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1090209","TextValue"=>"バンザイ！"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1090301","TextValue"=>"家を出た時、もう戻れないと思ってました。でもこの不思議な島を見つけてから、新しい友達ができて、なくなったと思ってた部族の仲間を復活させる方法も見つけました！"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1090302","TextValue"=>"このすべてを、我々の女神に感謝しなければ。彼女が私達を守って導いてくれました；私達の新しい友達、親愛なるアメイジンにも感謝を、彼は喜んで私達に知識を授けてくれました。"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1090303","TextValue"=>"でも一番はやはり、族長です。あなたの変わらない強さと優しさがなければ、私達はここまで来れませんでした。本当に、ありがとうございます。あれ……祭司、泣いていますか？"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1090304","TextValue"=>"私……泣いて……（しくしく）ないわ！ただ……（しくしく）もう！泣いてる！私は泣いてるわ！これで満足なの？！愛してるわ族長！あなたは最高の族長よ！"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1090305","TextValue"=>"はは、これで十分でしょう、族長。この先の未来が楽しみで仕方がないです。いつか、私達は家の謎を解き明かし、家を再建できると信じています。"],
13690=>["Value"=>13690,"TextKey"=>"剧情ID2010101","TextValue"=>"みんな焦らないで、もうすぐ着くわ……"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID2010102","TextValue"=>"神よ！私達は砂漠を何日も歩いています。そろそろ水をくれませんか？"],
13692=>["Value"=>13692,"TextKey"=>"剧情ID2010103","TextValue"=>"耐えるのよ！私はあなたの歳で……え、あれは何？"],
13693=>["Value"=>13693,"TextKey"=>"剧情ID2010201","TextValue"=>"うわあああああああああ！"],
13694=>["Value"=>13694,"TextKey"=>"剧情ID2010202","TextValue"=>"祭司？！"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID2010203","TextValue"=>"うそ、下にいるのか、祭司様？大丈夫ですか？"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID2010204","TextValue"=>"んん……まだ生きてる……うう、たぶん……この魔法鉱洞に落ちてしまった。"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID2010205","TextValue"=>"神に感謝を、無事でよかったです。安心してください、全力かつ最速で助けます。"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID2010301","TextValue"=>"族長、近くの山頂で建物の跡が見つかりました。そこで大きな製縄機が、ゴミの山に埋められています。"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID2010302","TextValue"=>"<color=#f58c26>旧工房</color>の類だと思います。"],
13700=>["Value"=>13700,"TextKey"=>"剧情ID2010303","TextValue"=>"あの扉を開けて、ある程度掃除もして、縄で滑車を作って祭司を引っ張りあげてはどうでしょうか？"],
13701=>["Value"=>13701,"TextKey"=>"剧情ID2010304","TextValue"=>"つべこべ言わないで、早く滑車ってやつを作って！"],
13702=>["Value"=>13702,"TextKey"=>"剧情ID2010305","TextValue"=>"急かさないでください、祭司様。もうすぐ日が暮れます。このまま外にいると凍え死んじゃいます。なので<color=#f58c26>テント</color>を作って、みんなが休憩できたらまた方法を考えます。"],
13703=>["Value"=>13703,"TextKey"=>"剧情ID2010306","TextValue"=>"じゃ私は？！私も凍死しちゃうよ！"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID2010307","TextValue"=>"心配いりません、地上では昼と夜の気温差が激しいですが、地下の温度は安定で居心地良いですよ。もう少しの辛抱ですよ、祭司様！"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID2020101","TextValue"=>"翌日……"],
13706=>["Value"=>13706,"TextKey"=>"剧情ID2020201","TextValue"=>"よく眠れました！祭司様、下は如何ですか？"],
13707=>["Value"=>13707,"TextKey"=>"剧情ID2020202","TextValue"=>"そんなこと聞く暇があれば、さっさと私をここから出しなさい！"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID2020203","TextValue"=>"方法は考えてますよ、あの工房の扉を開けるのに工具が必要です。落ち着いて、ね？（にっこり）"],
13709=>["Value"=>13709,"TextKey"=>"剧情ID2020204","TextValue"=>"待ってなさい……この偉そうなガキめ……"],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2020205","TextValue"=>"おや、傷つきますよ！私の好意をこんな風に捉えるなんて！でも許します。族長と私はすぐ戻りますから！"],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2030201","TextValue"=>"よし、入りました！あとは……"],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2030202","TextValue"=>"長官、気をつけて！後ろ！"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2030203","TextValue"=>"はっ！この矢はどこから？！"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2030204","TextValue"=>"出てこい！"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2030205","TextValue"=>"誰ですか？"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2030206","TextValue"=>"出てきなさい！誘拐犯め！"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2030207","TextValue"=>"誘拐犯？たぶん誤解ですよ、声のレディ……ああ痛！痛い！"],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2030301","TextValue"=>"声のレディ、今出てきましたよ。状況を説明してもらえませんかね？"],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2030302","TextValue"=>"まず、私は声のレディじゃない。私はトラハトガ、神速のハンター・マグルイスの娘・大地の母・女英雄……"],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2030303","TextValue"=>"偉大なるトラハトガ！！！！！"],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2030304","TextValue"=>"なっ……この声どこから……山の下？あの鉱洞に落ちたのか？"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2030305","TextValue"=>"あんた達、私が戻るまでそこにじっとしていろ！一步でも動いてみろ、どうなるかわかるよね。"],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2030306","TextValue"=>"わかりましたレディ、一步も動きません！"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2030401","TextValue"=>"そこに居るのか、祭司？ここで何をしてる？人を探すためにこの鉱洞を開けたのだが、なぜあんたが中にいるんだ？"],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2030402","TextValue"=>"手短に言うと、私はあなたに捕まえられた男の子達と一緒に来たけど、この鉱洞に落ちてしまった。でもこれはどうでもいいわ。だって私達はあなたに出会えたから！！この不毛の地で手助けしてくれる友人に出会えると予言したけど、まさかあなただったとは！！"],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2030403","TextValue"=>"友人？あんた達を助ける？何を？あんた達……誘拐犯じゃないのか？"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2030404","TextValue"=>"誘拐犯？いえいえ、私達は通りかかっただけ、家を救ってくれる助っ人を探してる途中なの……（説明中）"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2030405","TextValue"=>"ああ。言われてみれば、確かにあんた達みたいな人に出会うって母に言われたわ……それを言い残して居なくなったの。確かに相手を間違えたわ。"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2030406","TextValue"=>"母？"],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2030407","TextValue"=>"気にしなくていい、大した事じゃないさ。あの子達があんたを吊り上げるために製縄機を直そうとしてたが、私の罠にハマったのかな？"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030408","TextValue"=>"はい、賢いレディよ、その通りです。おかげでこの有様、片脚しか動きません。"],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030409","TextValue"=>"ああ、すまない、私のせいだ。あとで治療する。今は罠をはずし、あの製縄機も直してあげる……"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030501","TextValue"=>"製縄機が直りました。素晴らしいです、レディ！"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030592","TextValue"=>"素晴らしくない！早く私を引っ張り上げて！今、すぐに！"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030683","TextValue"=>"あと少しです。縄を作らないと、吊り上げられません。"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030774","TextValue"=>"あんたわざとでしょ……（涙）"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2040101","TextValue"=>"我が族長よ、もう素材は揃えましたか？別に急がなくてもいいですよ、祭司エンダーはいませんから。せっかく静かになった事ですし……"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2040102","TextValue"=>"聞こえてるわよ！自重しなさい！"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2040103","TextValue"=>"しまった！まさか聞こえてるとは……あは！滑車の準備できました！"],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2040201","TextValue"=>"親愛なる祭司、救援チームが降りています。見える場所に居てください、踏まれないようにご注意を……"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2040202","TextValue"=>"私の腰を踏んでる！退きなさい！"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2040203","TextValue"=>"もうすぐ祭司は戻ってきますね。感謝します、レディ。"],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2040204","TextValue"=>"レディって呼ぶな、私はトラハトガだ。さあ診せてくれ、さっきはどこに当たったんだ？"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2040205","TextValue"=>"私のすねに当たったのです、レディ、いえ、トラハトガ。"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2040206","TextValue"=>"そうか。狩人だから、傷の手当には慣れている。鉱洞の下に肉厚の葉を保管してある。この鉱洞を収納室代わりに使ってるからな。葉を砕いて、その汁をすねすねに塗って～"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2040207","TextValue"=>"あはは……すねすねって……わかりました。下に降りれば良いんですよね？"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2040208","TextValue"=>"いやいや、素人のあんた達ではたいまつなしじゃ何も見えないさ。この下はあんた達の思ったよりずっと深い。たいまつと発掘ツールを用意しなさい！"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2050101","TextValue"=>"これを持ちな、もし火が消えたら、先に進むのではなく、戻ってくるのよ、いいわね？"],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2050102","TextValue"=>"準備はできてる？行くわよ！足元に気をつけて！"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2050103","TextValue"=>"イエスレディ！"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2050104","TextValue"=>"族長、私と祭司と一緒に残ってくれて、感謝します。「この脚がいらないのなら井に降りてもいい」ってトラハトガに言われました、とても残念です。下で新発見があるか楽しみです！"],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2050105","TextValue"=>"偉大なるトラハトガがあなたに名前で呼ばれるのを許すなんて、信じられないわ。なんて光栄なことなの！なのにあなたには感激の気持ちがこれっぽっちもない……"],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2050201","TextValue"=>"ああ神よ、あれは何なの？"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2050202","TextValue"=>"地下水です！我々が<color=#f58c26>地下水</color>を発見しました！水を確保しました！"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2050203","TextValue"=>"ビショビショですけど。"],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2050204","TextValue"=>"このくらいではしゃぐな！ただの水じゃないか！"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2050205","TextValue"=>"よ、あんた、族長だよね、今は水があるし、<color=#f58c26>多肉植物</color>を植えようではないか！経読みとある程度の世話をすれば、葉一つで多肉植物に育てられるぜ！"],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2050206","TextValue"=>"この子達はあんたにあげるよ。バケツ、スコップと肥料を用意しろよ、ここで待ってる。"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2060101","TextValue"=>"よし終わった！可愛らしいよね！葉を摘み取って、大きいやつを。"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2060102","TextValue"=>"こんな植物は初めてです……え？摘み取るって？"],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2060103","TextValue"=>"そう、摘み取るんだ。汁を搾り取って、あんたの傷ついた皮膚に塗るの。"],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2060104","TextValue"=>"わかった……葉を摘み取って……塗る……わお、効いています！こんなに速く傷を治せる草薬なんて聞いてことがありません！"],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2060105","TextValue"=>"まっ、大地の母の名は伊達じゃないってね。この名をつけられたのも、園芸が得意からかな。これは普通の多肉植物じゃないよ、私が育てたんだから。"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2060106","TextValue"=>"まさに奇跡の創造者！神よ！家の謎がすべて解ける日が近いのでは！"],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2060107","TextValue"=>"その件についてだが。今の私は疲れ果ててる、休憩が必要なんだ。あんた達の家とやらにお邪魔しても良いかな？基地みたいなもんなのか？ベッドはあるか？"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2060108","TextValue"=>"そう、基地みたいな所です。これが戻る時に使う地図です。しかし……一晩だけでいるのですか、それとも私達のチームに加わってくれますか？"],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2060109","TextValue"=>"もちろんチームに入るわ、バカなのあんた？！あんた達は助けを求めてる、私は暇を持て余してる、答えは明白でしょ？どうせ同じ人を探してると思う。だから！地図はもらってくよ、じゃあね！"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2060201","TextValue"=>"行っちゃいました。彼女は私達の民と仲良くなれる気がします。さて仕事は残っています、拠点を作りますよ。前の拠点のように、資材を保管する<color=#f58c26>倉庫</color>が必要です。"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2060202","TextValue"=>"<color=#f58c26>倉庫</color>を作るのに必要な素材を集めましょう！"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2070101","TextValue"=>"できました！"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2070102","TextValue"=>"水源を見つけてあげたお礼はまだよね！私の場所に対する直感は正しいみたいね！"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2070103","TextValue"=>"はい、はい。これからは予言を心から信じ、無茶な要求を満足してあげます。次は何がほしいですか？"],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2070104","TextValue"=>"あなた……！まあいいわ。私は神と対話して、次の向かう方向を確認する。今度は<color=#f58c26>展望台</color>で天文学の占いをやってみるわ。"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2070105","TextValue"=>"なぜ天文学なんですか？あの星々が何なのかもわからないのに。つまり、あれはただ光ってるだけって言いたいんです！"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2070106","TextValue"=>"もう時間がないの！やることがいっぱい残っているの！出任せはもうやめなさい！"],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2070107","TextValue"=>"必要なものを持ってきて、今すぐ！"],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2070108","TextValue"=>"了解……"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2070201","TextValue"=>"大人は、「面倒な老人には関わるな」って。ちゃんと守っていればよかった……"],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2080101","TextValue"=>"族長は用事を済ませましたね。あとは祭司に言われた<color=#f58c26>展望台</color>だけです……"],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2080102","TextValue"=>"聞こえてるわよ！文句言わないで、手を動かしなさい！"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2080103","TextValue"=>"はいはい！はぁ…"],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2080201","TextValue"=>"よし、我が族長、神と対話しに行くわ。"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2080202","TextValue"=>"ちょっと休んでいて、またあとで。"],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2080203","TextValue"=>"こっちこっち、族長（ボソッ）"],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2080204","TextValue"=>"ようやくエンダーが静かになりました。"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2080205","TextValue"=>"隊員が鉱洞で黄金を発見しました。"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2080206","TextValue"=>"それを運ぶために箱を作ってもらえないか、お願いしに来たわけです。"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2080207","TextValue"=>"箱を作るための素材を集めていただけないでしょうか？"],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2090101","TextValue"=>"ふう、これはなかなかの黄金だぜ。"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2090102","TextValue"=>"何これ？光ってる……"],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2090201","TextValue"=>"小さな袋……「食べて」って書いてある。中身は……<color=#f58c26>光る種</color>？つまり、この種を食べるのでしょうか？"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2090202","TextValue"=>"待ちなさい！"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2090203","TextValue"=>"何？！祭司様、何をするんですか？"],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2090301","TextValue"=>"あれを食べちゃったの？！まだ何も調べてないのに！"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2090302","TextValue"=>"星々が<color=#f58c26>東南方面</color>にある<color=#f58c26>大峡谷</color>に導いてくれたわ。この<color=#f58c26>眠りの種</color>が私に……グゴーガゴー……"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2090303","TextValue"=>"祭司？祭司？大丈夫ですか？"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2090304","TextValue"=>"グゥ…スヤスヤ……グゴー…"],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2090305","TextValue"=>"そして眠ったようですね。霊能者ってのは理解に苦しみます。わけがわからない時もありますし。"],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2090306","TextValue"=>"えっと、祭司は気絶しちゃったし、どこへ行けばいいですか？"],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2090307","TextValue"=>"確かに<color=#f58c26>大峡谷</color>って言いましたよね？<color=#f58c26>東南方面</color>に？"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2090308","TextValue"=>"信じていいのか？あまり……まともじゃない様に見えますけど？"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2090309","TextValue"=>"もちろん。信じると約束しましたから。それに、他に行く当てはないでしょ？今日はこれで休む事にしましょう、明日は東南方面に向かって出発です。"],
13803=>["Value"=>13803,"TextKey"=>"剧情ID3010101","TextValue"=>"ちょっと、そこの若いの。"],
13804=>["Value"=>13804,"TextKey"=>"剧情ID3010102","TextValue"=>"うん？"],
13805=>["Value"=>13805,"TextKey"=>"剧情ID3010103","TextValue"=>"そう！ちょいとお婆さんに手を貸してくれないかい？"],
13806=>["Value"=>13806,"TextKey"=>"剧情ID3010104","TextValue"=>"えっと……私はここにいないんだけど。"],
13807=>["Value"=>13807,"TextKey"=>"剧情ID3010105","TextValue"=>"はあ？どうして？"],
13808=>["Value"=>13808,"TextKey"=>"剧情ID3010106","TextValue"=>"私は部族の仲間と一緒に居た。彼方此方旅して、家の謎を解いてくれる助っ人を探している……"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID3010107","TextValue"=>"わかった。私はあなたに話かけてるのよ、光る小箱を手に持っているあなた？"],
13810=>["Value"=>13810,"TextKey"=>"剧情ID3010108","TextValue"=>"この<color=#f58c26>スマホ</color>のこと？"],
13811=>["Value"=>13811,"TextKey"=>"剧情ID3010109","TextValue"=>"そうそう、<color=#f58c26>「あなたのスマホ」</color>。助けてくれるかい？"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID3010110","TextValue"=>"ちょっと待って……どうして匂いがわかるの？"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID3010111","TextValue"=>"そうね、私は目こそは見えないけど、感じ取ることはできる。あなたもそのうちわかるわ。どうなの、助けてくれるかい？"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID3010112","TextValue"=>"わかった。何をすればいい？"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID3010113","TextValue"=>"あなたの部族の人はここを通るわよね？お腹ペコペコの人のふりをして、ガラクタの<color=#f58c26>露店</color>を出すの。やばい！私は天才だわ！"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID3010114","TextValue"=>"わからん……"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID3010115","TextValue"=>"いい加減で粗暴なやつを助けたくないでしょ？私は良い人しか助けないわ。 "],
13818=>["Value"=>13818,"TextKey"=>"剧情ID3010116","TextValue"=>"それで？"],
13819=>["Value"=>13819,"TextKey"=>"剧情ID3010117","TextValue"=>"物を買ってくれて食べ物をくれたら、まあまあってとこかね、直接食べ物をを渡してくれたらもっと良い！"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID3010118","TextValue"=>"さもないと、気の毒だが、私の指の一鳴らしであなた達部族は消えるわ。わかったかい？わかったらステージに入って素材を集めておくれ！"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID3020101","TextValue"=>"お見事！ありがとう！"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID3020102","TextValue"=>"娘もあなたみたいに頼もしくて手際よければ良いわね。"],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3020103","TextValue"=>"砂漠で娘とはぐれて、道に迷ってしまったの……私は方向感覚が悪いの。"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3020104","TextValue"=>"彼女は今どこに居るか知ってる？"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3020105","TextValue"=>"もちろんよ！でも彼女にも私を探してもらわないと！"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3020201","TextValue"=>"せめて雷くらい投げてくれても！"],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3020301","TextValue"=>"今も悪くない、でしょ？あなたと私だけで、気楽に、のんびりと、お話を……"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3020302","TextValue"=>"彼らは来るわ、もう少し待つだけよ。"],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3020303","TextValue"=>"大分経った後"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3020304","TextValue"=>"私は骨の山に登って彼らがどこに居るのかを確かめるわ。"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3020401","TextValue"=>"あそこね！うわ、あの祭司ちゃんかっこいい！"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3020402","TextValue"=>"もうすぐ着くわね。会うのが楽しみだ！さて降りる時は気をつけて……"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3020501","TextValue"=>"大丈夫？"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3020502","TextValue"=>"おーい？"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3020601","TextValue"=>"少し経った後"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3020701","TextValue"=>"「腹が減って死にそうだ。何か買ってください。食べ物をください。」へえ……ここで事業を起こす人がいるとは。"],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3020702","TextValue"=>"あ、族長、来たんですね。祭司は夢でこの竜骨の所に呼ばれたと言いました。"],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3020703","TextValue"=>"やはり人が居た痕跡はあります。しかし焚き火の跡は冷えていますし、近くに人の気配もありません……もしかしてすっぽかされました？"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3020704","TextValue"=>"いずれにせよ、ここでテントを張って休みましょう。ついで祭司の言ってた人を待ちます！ "],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3020801","TextValue"=>"疲れた、ようやく着いたわね...日差しが強いし、マントを羽織ったままじゃ蒸されてしまうわ！はやくマントを脱がなくちゃ！"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020802","TextValue"=>"敬愛なる祭司よ、ラクダの背中でよく寢ってましたよね、疲れたのはこっちですよ。"],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020803","TextValue"=>"それに、マントを脱がないでください。ゴビと砂漠地区の昼は暑いですが、夜はとても冷えます。"],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020804","TextValue"=>"神よ…なぜこんなに所まで行かせたのでしょう…この傲慢な若者も一緒だなんて……"],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020805","TextValue"=>"もう少しの我慢を、族長は急ぎで旅用の<color=#f58c26>テント</color>の素材を集めてくれます。"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3030101","TextValue"=>"さすがです、こんなに速く素材を揃えてくれました。ではやりましょう！"],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3030201","TextValue"=>"みんなお腹が空いたと思うので、この焚き火を借りて料理と簡単な休憩場を作りましょうか。「腹が減っては仕事はできぬ」ってね！"],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3030202","TextValue"=>"よっしゃ！！！食べ物だ！ベーコンだ！"],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3030203","TextValue"=>"私はラムステーキがいいな……"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3030204","TextValue"=>"この残虐な肉食動物達め！"],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3030205","TextValue"=>"では何が食べたいですか？"],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3030206","TextValue"=>"ステーキ、ミディアムレア、ホースラディッシュでお願い。"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3030207","TextValue"=>"祭司様、それも……"],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3030208","TextValue"=>"知ってるわ！黙りなさい！"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3030209","TextValue"=>"はは、旅人にとって、タンパク質の補充は大事ですからね。ここまで来れたのも大変ですし、たまには良い物食べませんと！族長、如何でしょうか？"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3030210","TextValue"=>"食材が足りない……"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3030211","TextValue"=>"羊肉、ビーフジャーキーとりんごがあります、族長様！"],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3030212","TextValue"=>"族長の言う通りです。異常気象に備えるためにも、別のタンパク質源を探さなきゃいけません。"],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3030213","TextValue"=>"ここに来る途中で砂漠トカゲを見かけました。トカゲとその卵は良いタンパク質源です！"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3030214","TextValue"=>"何だって？！トカゲ？！食えるかあんなもん？！"],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3030215","TextValue"=>"そういう珍しい食材に少し工夫を施せば珍味になれますよ！例えばトカゲシチュー、聞いただけで美味そうです！"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3030216","TextValue"=>"もう待ちきれません！"],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3030217","TextValue"=>"はいはい……トカゲを捕りますよ……"],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3040101","TextValue"=>"なんと！素材を全て集めてくれたんですね。では始めましょう！"],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3040102","TextValue"=>"よっしゃ！点火！"],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3040201","TextValue"=>"ついに……食べ物が……もう動けない……目玉焼き……ステーキ……焼きりんご……"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3040202","TextValue"=>"アランはラムステーキ、ケビンは目玉焼き……祭司エンダーと私はこの美味しいトカゲシチューをいただきます……"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3040301","TextValue"=>"誰があなたとトカゲシチューなんかを食べるの！"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3040302","TextValue"=>"そうですか、ならこの熱々の美味は新しい友達にあげます。"],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3040303","TextValue"=>"新しい友達？なにそれ？"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3040401","TextValue"=>"ああ！！！！神よ！！！この鼠達を何とかしてください！"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3040402","TextValue"=>"まず彼らは鼠ではありません。こんな大きな鼠はいません。私の観察によると、こいつらは砂漠とゴビ地区しかいない生き物、砂鼠です。"],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3040403","TextValue"=>"あとこいつらは群居性の動物であり、臆病で敏感です。体は大きいけれど、温厚で人にはまったく無害です。"],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3040404","TextValue"=>"はいはいわかった！！！こいつらは何なのかはどうでもいいわ、さっさと私から離して！"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3040405","TextValue"=>"うーん……言われてみれば、妙ですね。なぜあなたを怖がらないのですか？誰かに飼われていたのかもしれません……"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3040406","TextValue"=>"親愛なる職人達よ、このかわいい子達を祭司から離してくれませんか？"],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3040407","TextValue"=>"了解！"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3040501","TextValue"=>"なっ！！！返しなさい！！！"],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3040502","TextValue"=>"逃げてしまいましたね。祭司以外の人を怖がっているみたいですね？"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3040503","TextValue"=>"私の指輪が奪われたわ！私の大切な指輪が……"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3040504","TextValue"=>"可哀想な祭司……あの竜骨を調べてあげなくもないですよね？あの子達に興味が湧いてきましたので。"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3040505","TextValue"=>"しかしあそこは険しい。<color=#f58c26>風車</color>で職人を運ぶ必要があります。"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3050101","TextValue"=>"車の素材は用意しましたか？よし！やってやりますよ！"],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3050102","TextValue"=>"風車の出来上がり！"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3050201","TextValue"=>"素敵な風車です！これはあれば安全かつ便利に行き来できます！"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3050202","TextValue"=>"よし！私の指輪を取り戻しなさい！神聖な代物なのよ！"],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3050203","TextValue"=>"はいはい！行ってきます！ケビン、アラン、準備はできましたか？"],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3050204","TextValue"=>"いつでも！"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3050205","TextValue"=>"うーん……長官……私が特別怖がりな訳でもないと思うのですが、崖から墜ちないように、縄が必要かと……"],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3050206","TextValue"=>"はっ！その通りですね、安全第一！なので族長、お願いできませんか。"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3060101","TextValue"=>"準備はできましたかね？"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3060102","TextValue"=>"できました！"],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3060103","TextValue"=>"よし！砂鼠の謎を解きに行きます！楽しみですね！"],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3060104","TextValue"=>"私の指輪を忘れないで！"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3060201","TextValue"=>"わお、この骨の山は凄いですね！待って……下に光る物が……んん……エンダーの指輪かな？"],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3060202","TextValue"=>"族長！見つけました！汚い老婦人を！"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3060203","TextValue"=>"祭司の指輪も。"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3060301","TextValue"=>"シクシク……アラン、ありがとう。あなたはこの中で一番話が通じる人ね……ええ……何？"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3060401","TextValue"=>"チュウウウウウウウウ！！"],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3060402","TextValue"=>"あの……ありがとう？"],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3060403","TextValue"=>"チュウチュウ！"],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3060501","TextValue"=>"チュウウウウウウウウ！！"],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3060502","TextValue"=>"やあ！こんにちは！親切な人達だね！私達は知り合いだっけ？この毛皮の感覚、どこかで……"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3060503","TextValue"=>"あ！私の夢に出てきた祭司ちゃんよね！現実のほうが可愛らしいわ～"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3060504","TextValue"=>"ちゃん？ちゃんつけ？！私は高貴なる神の使者…"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3060505","TextValue"=>"すみません、夢で祭司と会ったのですか？"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3060506","TextValue"=>"ほう～若者！そうよ！夢で祭司ちゃんと会ったの。夢で「ここで待ってる」って伝えたけど、わたしにゃさっぱり意味がわからんよ！"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3060507","TextValue"=>"何であなたも意味がわからないのよ？！"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3060508","TextValue"=>"変な話、私は自分の名前すらわからないの、あの奇妙な夢の意味は尚更さっぱり。"],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3060509","TextValue"=>"穴に墜ちた時に頭を強く打ったの。ほら、歩く時もふらついてるでしょ。"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060510","TextValue"=>"隣にあったのがあなたの露台ですか？「腹が減って死にそうだ。何か買ってください。食べ物をください」って？"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060511","TextValue"=>"ここは何もないし、露台には今の私の体の状態と考えをが正確に書かれているんだもの。私のだと思うわ。"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060512","TextValue"=>"心配いりません。食べ物ならたくさん持ってきました。テントでゆっくりどうぞ。"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060513","TextValue"=>"それはよかった！"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060514","TextValue"=>"あ、あともう一つ。空気からベーコン、焼きりんごと……<color=#f58c26>迫り来る嵐</color>の匂いがする。備えたほうがいいわよ。"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060601","TextValue"=>"で……そのまま行っちゃいました。はあ、族長も聞いていましたよね。風が強くなる、そうですね……"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060602","TextValue"=>"テントを固めたほうがいいみたいですね。"],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060603","TextValue"=>"どうして彼女の言う通りにするの！どこの馬の骨とも分からない者の話を信じるの？"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060604","TextValue"=>"私の予言はいつもバカにしてるくせに！あの老人を問い詰めて、正体を暴いてやる！"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060605","TextValue"=>"はははは、祭司が不服みたいです。<color=#f58c26>テントを固める</color>素材のリストはこちらです。族長様、ご確認を。"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3070101","TextValue"=>"うん、良いお茶だ。"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3070102","TextValue"=>"このクッキーも悪くないね、口の中でとろけるワ。外縁部が少し焦げているかしら。"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3070103","TextValue"=>"次は火加減を弱くして、時間を適当に長くすれば完璧ですワね。"],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3070104","TextValue"=>"なんでアフタヌーンティーを楽しんでるのよ？！"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3070105","TextValue"=>"何か問題でも？"],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3070106","TextValue"=>"そして何その変な口調！生きてる時代も違うじゃないの！"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3070107","TextValue"=>"リラックスヨ、可愛い祭司ちゃん。すべては過ぎていくし、いずれわかるワ。"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3070108","TextValue"=>"いや！それはない！過ぎることはないし、何もわからないわ！！神よ……あなたは一体どこから来たのよ！"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3070109","TextValue"=>"そんなに知りたいの。実はアフタヌーンティーのおかげで、ノスタルジアが蘇ったの……"],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3070110","TextValue"=>"そして私の記憶が戻った。実は、あの、実のところ、えっと、本当の話……"],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3070111","TextValue"=>"はっきり言えないの？！"],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3070112","TextValue"=>"あの<color=#f58c26>露台</color>を、固めてくれない？"],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3070113","TextValue"=>"はあ？！"],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3070114","TextValue"=>"か弱い老人が独りぼっちでゴビを歩いてたの。もうお腹がペコペコ……ああ！なんて可哀想な！"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3070115","TextValue"=>"この露台が壊れたら、私が悲しむ。だから、お願い！恩に着るわ！"],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3070116","TextValue"=>"面白い婆さんです。"],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3070117","TextValue"=>"あなた今何を？"],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3070118","TextValue"=>"族長様、素材リストはこちらです、ご確認を！"],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3070119","TextValue"=>"無視すんな！！"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3080101","TextValue"=>"良いわね、あなた達は最高よ！"],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3080102","TextValue"=>"母さん！やっぱり！やっぱり母さんだ！"],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3080201","TextValue"=>"偉大なトラハトガ、どうしてここに？！"],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3080202","TextValue"=>"この若い女性は……？"],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3080203","TextValue"=>"トラハトガ！あなたの娘！惚けるな！"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3080204","TextValue"=>"穴から目の見えないババアを見つけたって聞いたから、もしかして、と思って様子を見に来たの。"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3080205","TextValue"=>"やっぱり母さんだ！"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3080206","TextValue"=>"トラハトガの母……トラハトガに母が居るなんて初耳だ……"],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3080207","TextValue"=>"母が居て当たり前だろこのボケ！"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3080208","TextValue"=>"言葉に気をつけなさい。"],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3080209","TextValue"=>"このまともじゃない女性があんた達のマグルイスだ。今目の前に居る。"],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3080210","TextValue"=>"マグって呼んでいいわよ。"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3080211","TextValue"=>"マグルイスは男だと思ってた……"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3080212","TextValue"=>"まあ、私の母は色んな名を持ってる。私が小さい頃も、母は正体を隠してて。"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3080213","TextValue"=>"目の見えない女と三歳の子ともは簡単に利用できそうでしょう？"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3080214","TextValue"=>"人々はこうして物語を広めたと思う……全能のドルイド、全知の戦士、強大な騎士……"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3080215","TextValue"=>"本当は、変なユーモア感を持つ盲目ババアだった。"],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3080216","TextValue"=>"マグルイスは女……マグルイスに不敬を働いた……ああ、もう終わりだ、私は祭司失格だ……"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3080217","TextValue"=>"祭司ちゃん、悲しまないで。良い勉強になったでしょ～今回は許してあげる。だって可愛いんだもん～"],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3080218","TextValue"=>"騙したのですか？記憶はなくしていないですか？"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080219","TextValue"=>"そうよ...ごめんね。長旅はつまらないでしょ？楽しいことをやらないと～"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080220","TextValue"=>"でも、あの美しいテントと露台を見て！これでこそ「拠点」よ！何か足りない気はするけど……"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080221","TextValue"=>"何が？"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080222","TextValue"=>"どれどれ……"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080301","TextValue"=>"大門ね！拠点の入口となる大門が必要。そして灯りを飾っておけば、それはもう最高に美しい！"],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080302","TextValue"=>"私達はあなたの忠実な下僕として、直ちに大門を作ります、マダム！族長、もたもたしないで！"],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3090101","TextValue"=>"材料は用意できた？よし！仕事だ仕事！"],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3090201","TextValue"=>"ああ！元気が湧き出てる！これが私の初めての工事……"],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3090202","TextValue"=>"おめでとうございます、祭司、成長しましたね。マグは今の拠点にご満足でしょうか？"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3090203","TextValue"=>"他は良いけど、空は何もなくてつまらないね……"],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3090204","TextValue"=>"はい！はい！空に浮く信号風船があります！"],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3090205","TextValue"=>"グッドアイデア！ちょっと工夫すれば、もっと素敵になれるわ！"],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3090206","TextValue"=>"光る黄色とピンク色の石はまだあるの？"],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3090207","TextValue"=>"あります！"],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3090208","TextValue"=>"よかった、少し待ってください。ケビン、ついてきなさい。"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3090301","TextValue"=>"ゴホン、疲れたわ。見てこの小物達！綺麗でしょう？"],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3090302","TextValue"=>"確かに。"],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3090303","TextValue"=>"気に入ってくれてよかった。母さんはよく変な物作るから。とりあえず、もう遅いから、私は帰るね。"],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3090304","TextValue"=>"今ですか？"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3090305","TextValue"=>"そうよ、他にどうしろと？臭い男達と同じテントに居るのはごめんだよ！母さん、一緒に帰る？"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3090306","TextValue"=>"あとで行くわ。あなたの新しい友達はかわいいね、特にこの祭司ちゃん～もっと遊んでほしいわ～"],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3090307","TextValue"=>"母さん、少し落ち着いて。"],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3090308","TextValue"=>"はいはい、落ち着いてるよ。これから長い付き合いになるし。"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3090309","TextValue"=>"うん、じゃまたあとで。"],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3090401","TextValue"=>"つまり私達と同行してくれますか？"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3090402","TextValue"=>"もちろん！しない理由はない！あなた達の旅は段々大変になるんだから。"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090403","TextValue"=>"私にできることは限られてるけど、未来のことなら少し教えられるわ。"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090404","TextValue"=>"でもあなた達の家まで道案内して。私の方向感覚は……呆れるほど悪いの。"],
13987=>["Value"=>13987,"TextKey"=>"剧情ID4010101","TextValue"=>"ふぅ…なんでこんなところがあるんだ！足が炎を踏んでいるようだ。"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID4010102","TextValue"=>"素晴らしい、エンダー！ふぅ…4時間前から、5文字以上の文を話していない。"],
13989=>["Value"=>13989,"TextKey"=>"剧情ID4010103","TextValue"=>"私は…疲れすぎて…暑すぎて…"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID4010104","TextValue"=>"君達！単なる火山だ。地面にしゃがむ様子を見て！"],
13991=>["Value"=>13991,"TextKey"=>"剧情ID4010105","TextValue"=>"トラハトガさん…あなたの汗も絶え間なく流れている。大丈夫か？"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID4010106","TextValue"=>"私をトラハトガと呼んで！…あまり疲れていないが、本当に暑すぎた。ここは海よりもはるかに危険だ。"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID4010107","TextValue"=>"到着したようだ。"],
13994=>["Value"=>13994,"TextKey"=>"剧情ID4010108","TextValue"=>"そうね！女神の指示によると、燃える海とその中の島…"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID4010109","TextValue"=>"はい、ここにあるに違いない！"],
13996=>["Value"=>13996,"TextKey"=>"剧情ID4010110","TextValue"=>"しかし、アメイジンはどこに？アメイジンはずっと前に到着して、ここで待っていたはずだ。しかし、彼はどこでも見られない。"],
13997=>["Value"=>13997,"TextKey"=>"剧情ID4010111","TextValue"=>"アメイジンのメッセージを感知するために祭壇を建てる必要がある。だが……"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID4010201","TextValue"=>"チーフ、私..."],
13999=>["Value"=>13999,"TextKey"=>"剧情ID4010202","TextValue"=>"エンダー！"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID4010203","TextValue"=>"エンダー！"],
14001=>["Value"=>14001,"TextKey"=>"剧情ID4010204","TextValue"=>"熱射病に違いない！急いで、日陰の場所を作って、彼女を休ませて！"],
14002=>["Value"=>14002,"TextKey"=>"剧情ID4020101","TextValue"=>"建設が完了しました！"],
14003=>["Value"=>14003,"TextKey"=>"剧情ID4020102","TextValue"=>"神様、わたし、もう少し長生きできるようです…"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID4020103","TextValue"=>"暑すぎる！海水の匂いが本当に恋しい…"],
14005=>["Value"=>14005,"TextKey"=>"剧情ID4020104","TextValue"=>"ふぅ、私たちの司祭はずっと良く見える。"],
14006=>["Value"=>14006,"TextKey"=>"剧情ID4020105","TextValue"=>"テントがある方がいいが、熱気が迫っていない…"],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4020106","TextValue"=>"しかし、それだけは少し良くなった。"],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4020107","TextValue"=>"女神様よ、もっと均等に焼けるように私をひっくり返せば？"],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4020108","TextValue"=>"ここは確かに大きなオーブンだと言わざるを得ない。"],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4020109","TextValue"=>"見て！あそこの低地。"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4020110","TextValue"=>"待って！母は本当に天才を産んだ。"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4030101","TextValue"=>"素晴らしいトラハトガ！それは水だ、水だよ！"],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4030102","TextValue"=>"ねえ、私たちの敬虔な司祭が女神を見たと思った。"],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4030103","TextValue"=>"私は完全に生きていて、元気にもなった！"],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4030104","TextValue"=>"確かにもっと元気だと見える。"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4030105","TextValue"=>"それじゃ、あなた、あなた、そしてあなたは、急いで訓練場を建設して！"],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4030106","TextValue"=>"訓練場？"],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4030107","TextValue"=>"はい、そうだ！"],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4030108","TextValue"=>"アメイジンを見つけてはいけないと思ったが…"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4030109","TextValue"=>"あの強いアメイジン、私は知っています。彼について心配する必要はない。"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4030110","TextValue"=>"もう一度君達を見てください。全く死にそうで。"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4030111","TextValue"=>"確かに、エンダーは運動が必要です。"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4030112","TextValue"=>"黙れ！"],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4030113","TextValue"=>"母の予測によると、嵐はもっと大きくなるだけ…"],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4030114","TextValue"=>"マグルイスの予言か…"],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4030115","TextValue"=>"若者よ！"],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4030116","TextValue"=>"はい！"],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4040101","TextValue"=>"北のあの高原を見て！はしごまである。"],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4040102","TextValue"=>"そうだ！"],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4040103","TextValue"=>"真ん中のコラムに気づいたか。それは自然に形成されたはずはない。"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4040104","TextValue"=>"そのような高さと形から見て、私の司祭家族の名誉に賭けて、ここ昔は祭壇だったに違いない！"],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4040105","TextValue"=>"この祭壇は荒れ果てているね。"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4040106","TextValue"=>"はい、大昔のものだろう。"],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4040107","TextValue"=>"そのような祭壇はアーチドルイドの力と共鳴することはできない。アメイジンは見つからない。"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4040108","TextValue"=>"チーフ、エネルギーを凝縮できる装置が必要だ。"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4040109","TextValue"=>"材料はここの温度に耐えることができなければならない。形も集められなければならない…"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4040110","TextValue"=>"マグマの中の奇妙な牙はどう？"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4040111","TextValue"=>"よし！アラン、来る前に女神のプロンプトは重要なパートナーと一緒に行くべきだと言った。確かに！"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4040112","TextValue"=>"確かにそうだ。女神に感謝します！"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4040113","TextValue"=>"黙れ！君だけを除く！"],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4040114","TextValue"=>"材料は我々の偉大なチーフに！"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4050101","TextValue"=>"チーフ、完成した。"],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4050102","TextValue"=>"祭壇は問題なく使用できるはずだ。"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4050103","TextValue"=>"しかし、今、憂鬱な空を見ると、エンダーが祭壇を上り下りするのは難しすぎて、倒れたらどうなるだろうか。"],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4050104","TextValue"=>"はい、あの…なにスタン、君は時々それほど嫌いではない。"],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4050105","TextValue"=>"結局のところ、エンダーは確かに年をとった。ええと、あまり若くない。"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4050106","TextValue"=>"私に腹を立てるのはそんなに良い？"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4050107","TextValue"=>"じゃ階段の両側に松明を作ろう。とても簡単だ！"],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4060101","TextValue"=>"この祭壇は…まだ何かが欠けている。女神の情報を感知することができない。"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4060102","TextValue"=>"アメイジンを感知できるはずだ。"],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4060103","TextValue"=>"寒い…はい…誰か…"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4060104","TextValue"=>"アメイジン！どこにいる？"],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4060105","TextValue"=>"あなた…エンダーか？どこにいるのかわからない…でもここはとても寒い…"],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4060106","TextValue"=>"寒い？"],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4060107","TextValue"=>"彼はここにいないようだ。"],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4060108","TextValue"=>"移動できません…助けて、$#^*,!@%&:?""],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4060109","TextValue"=>"何って言った？"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4060110","TextValue"=>"ねえ、エンダー…"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4060111","TextValue"=>"L"＆％*@＃$"……"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4060112","TextValue"=>"アメイジン、ちょっと待って！今、他の人と話したい。多分君を助けることができる。"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4060113","TextValue"=>"トラハトガ、この状況を見たことがあるか。"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4060114","TextValue"=>"ねぇ…"],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4060115","TextValue"=>"精神的なコミュニケーションは私の専門じゃない。しかし、母もこの状況に遭遇したことがある。それはまた祭壇の原因であるはずだ。"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4060116","TextValue"=>"祭壇の力はまだ弱すぎて、最も重要なリンクが欠けている。"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4060117","TextValue"=>"女神の力……@＃$>：％^エッセンス……"],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4060118","TextValue"=>"チーフ、知っている！祭壇の柱の上を見て。"],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4060119","TextValue"=>"精神を補い、祭壇の力を高める必要がある。そんなものはあるか。"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4060120","TextValue"=>"何を言っているか。アラン、すぐに渡す。"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060121","TextValue"=>"問題ない！"],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4070101","TextValue"=>"アメイジン、何か言って！"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4070102","TextValue"=>"私を見つける必要がある…"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4070103","TextValue"=>"今回は問題ない。さき、君の声はまるでマグが咳をするふりのように聞こえた。"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4070104","TextValue"=>"マグの年はもうおばあさんになったのよ。"],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4070105","TextValue"=>"そういえば…"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4070106","TextValue"=>"火山に行ったことがあるが、何が起こったのかわからなくなった。目覚めたときはもうここにいる。"],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4070107","TextValue"=>"祭壇は私に連絡することができますが、この場所を君達に導くことはできないと思う。"],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4070108","TextValue"=>"私はエンダーに応えるが、この場所は絶対に応えない。隠す可能性さえある。"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4070109","TextValue"=>"何か方法が？"],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4070110","TextValue"=>"環境と共存するために…果てしないサイクルを形成する。"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4070111","TextValue"=>"どういう意味？ここの火をあなたの氷室に流すとか？"],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4070112","TextValue"=>"もちろん違う。"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4070113","TextValue"=>"循環…マグマを流し、フライアッシュを上昇させ、灰を冷まし、石を再びマグマに変える。"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4070114","TextValue"=>"さすがエンダー。"],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4070115","TextValue"=>"待って！"],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4080101","TextValue"=>"これは...豚の頭か？"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4080102","TextValue"=>"うん。"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4080103","TextValue"=>"なぜそれが豚の頭の形をするか。"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4080104","TextValue"=>"ちょっと待って、この質問を聞くべきではなかったようだ。"],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4080105","TextValue"=>"成功への道をすすむために、愛する仲間は不可欠だ。だから、なんでトリスタンの象徴をここに残してみないか？"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4080106","TextValue"=>"私たちの司祭が本当にかわいいね。"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4080107","TextValue"=>"君！"],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4080108","TextValue"=>"どいて、チーフと私はこの循環を始めようとする。"],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4090101","TextValue"=>"ふぅ、エンダー、まかせて。"],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4090102","TextValue"=>"アメイジンは…"],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4090103","TextValue"=>"極東の…氷が凍る土地にいる。"],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4090104","TextValue"=>"今はまだ暑いが、冬支度を用意したほうがいいと思う。"],
